import styled from "styled-components"

export const Container = styled.div`
    p {
        font-size: 13px;
        color: #b8b8d4;
    }
    h1 {
        margin: 0;
        padding: 0;
        font-size: 26px;
    }
    hr {
        height: 1px;
        border: 0;
        background-color: #16195c;
        margin: 30px 0;
    }
`;
